import axios from 'axios'

const Evolution = ({evolution_chain}) => {
    useEffect(() => {
        console.log(evolution_chain)
        axios.get(evolution_chain)
            .then(res => {
                console.log(res)
            })
    })

    return null
}

export default Evolution
